export function randomHumanSurname() {
  const part1 = random.element(NPC_NAMES_BY_RACE.human.surname1);
  const part2 = random.element(NPC_NAMES_BY_RACE.human.surname2);

  if (part1.toLowerCase() === part2.toLowerCase()) return part1;
  return random.element([
    part1 + part2,
    random.element(NPC_NAMES_BY_RACE.human.surname),
  ]);
}

export function randomKoboldSurname() {
  const surname1 = random.element(NPC_NAMES_BY_RACE.kobold.surname1);
  let surname2 = random.element(NPC_NAMES_BY_RACE.kobold.surname2);
  while (surname1 === surname2) {
    surname2 = random.element(NPC_NAMES_BY_RACE.kobold.surname2);
  }

  return surname1 + surname2;
}

